import {AppBar, Button, Card, CardActions, CardContent, IconButton, Toolbar, Typography} from '@material-ui/core';
import React, {FunctionComponent, useEffect} from 'react';
import './roadmap.css';
import IconImage from "./assets/solana_road_map_icon.jpg";
import Grid from '@mui/material/Grid';


const GridCard: FunctionComponent = ()=>{

    useEffect(() => {

    });

    const Item = styled(Paper)(({ theme }) => ({
        ...theme.typography.body2,
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    }));

    return (
        <Grid container
                direction="column"
                justifyContent="center"
                alignItems="center"
                className="gridRoadmapContainer">
            <Grid container
                  direction="column"
                  justifyContent="center"
                  alignItems="center"
                  className="gridRoadmapDetail">
                <img src={IconImage} className="iconImage" alt={"icon image"}/>
            </Grid>
            <Grid container
                  spacing={2}
                  className="gridRoadmapDetail">
                <Grid item xs={4}>
                    <Item>Row Title: </Item>
                </Grid>
                <Grid item xs={8}>
                    <Item>Row Details </Item>
                </Grid>
            </Grid>
        </Grid>
    );
}

export default GridCard;
